import React from "react";

import * as Section from "components/PageSection";

export const Intro = () => (
  <Section.Wrapper>
    <Section.Content>
      <Section.Header>
        <Section.Title>Hello, our future Front-end Developer!</Section.Title>
        <Section.Description>
          So, imagine you have joined our team and this is your first project.
          Below you will find the description of assigned tasks - go ahead, show off
          your skills!
        </Section.Description>
      </Section.Header>
    </Section.Content>
  </Section.Wrapper>
);
